import React from 'react';

import { Top } from './Top';
import { Navigation } from './Navigation';
import { Links } from './Links';

export class Footer extends React.Component {
	render() {
		return (
			<div className="footer-contents">
				<div>
					{/* <Top /> */}
				</div>

				<div>
					<Navigation />
				</div>

				<div>
					<Links />
				</div>
			</div>
		);
	}
}
